import React from 'react'
import ReactDOM from 'react-dom/client'
import './index.css'
import NavBar from './components/Navbar'
import Hero from './components/Hero'
import Card from './components/Card'
import photo from "./images/katie-zaferes.png"
import photo1 from  "./images/mountain-bike.png"
import photo2 from "./images/wedding-photography.png"
import data from './components/data'




const card = data.map((data)=>{
  return(
    <Card
      img={data.coverImg}
      ranking={data.stats.rating}
      country ="USA"
      reveiewcount={6}
      title="Life lessons with Katie Zaferes"
      price="$136"
    />
  )
})

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(

  <div>

    <NavBar />
    <Hero />
    <Card img={photo}
          ranking={5.0}
          country ="USA"
          reveiewcount={6}
          title="Life lessons with Katie Zaferes"
          price="$136"

    />
    <Card img={photo1}
          ranking={4.0}
          country ="Mexico"
          reveiewcount={7}
          title="Life lessons with Katie Zaferes"
          price="$136"
    />
    <Card img={photo2}
          ranking={6.0}
          country ="England"
          reveiewcount={8}
          title="Life lessons with Katie Zaferes"
          price="$136"
    />



  </div>

)
